import React, { useState, useEffect } from "react";
import {
  Text,
  View,
  StyleSheet,
  TouchableOpacity,
  ImageBackground,
  TextInput,
  Image,
  ScrollView,
  FlatList,
} from "react-native";

import { Ionicons, AntDesign } from "@expo/vector-icons";
import { fetchAllPet, searchPet } from "../redux/actions/petActions";
//step1
import { useDispatch, useSelector } from "react-redux";
//import ReadMore from "@fawazahmed/react-native-read-more";

const Product = ({ navigation }) => {
  const dispatch = useDispatch();
  const db = useSelector((store) => store.pets);
  console.log(db);
  const [data, setData] = useState([]);
  const [search, setSearch] = useState("");

  useEffect(() => {
    dispatch(fetchAllPet());
    setData(db.pets);
    console.log("all pet", data);
  }, []);
  const Search = (key) => {
    dispatch(searchPet(key));
  };

  const HeaderComponent = () => {
    return (
      <View style={styles.headerListComponent}>
        <Text style={styles.HeaderTitle}>LIST PET</Text>
      </View>
    );
  };
  const ItemComponent = ({ item }) => {
    return (
      <View key={item.docId} style={styles.ItemComponent}>
        <Image source={{ uri: item.Image }} style={styles.img} />

        <View style={styles.itemDetail}>
          <Text style={styles.name}>Tên: {item.Name}</Text>
          <Text style={styles.price}>Giá: {item.Price} VNĐ</Text>
          <View style={styles.footer}>
            <TouchableOpacity
              style={styles.btn}
              onPress={() => {
                navigation.navigate("ProductDetail", {
                  petId: item.id,
                  petName: item.Name,
                  petAge: item.Age,
                  petGender: item.Gender,
                  petCID: item.CateID,
                  petOrigin: item.Origin,
                  petPrice: item.Price,
                  petCondition: item.Condition,
                  petImage: item.Image,
                });
              }}
            >
              <Ionicons name="search" size={24} color="black" />
              <Text style={styles.btnTxt}>View Detail</Text>
            </TouchableOpacity>
          </View>
          <View style={styles.footer}>
            <TouchableOpacity style={styles.btn}>
              <AntDesign name="shoppingcart" size={34} color="black" />
              <Text style={styles.btnTxt}>Add to cart</Text>
            </TouchableOpacity>
          </View>
        </View>
      </View>
    );
  };
  return (
    <View style={styles.container}>
      <ImageBackground
        style={styles.background}
        resizeMode="cover"
        source={{
          uri: "https://wallpaperwoo.com/uploads/pictures/wallpapers/original/87053_6b954a8c0fe03e9cc30f94964febce9a.jpg",
        }}
      >
        <View style={styles.searchView}>
          <TextInput
            placeholder="Search"
            style={styles.inputText}
            onChangeText={(text) => setSearch(text)}
          />
          <TouchableOpacity
            style={styles.btnSearch}
            onPress={() => Search(search)}
          >
            <Text style={styles.searchTxt}>Tìm kiếm</Text>
          </TouchableOpacity>
        </View>
        <FlatList
          data={db.pets}
          ListHeaderComponent={HeaderComponent}
          renderItem={ItemComponent}
        ></FlatList>
      </ImageBackground>
    </View>
  );
};
export default Product;
const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#eeeeee",
  },
  background: {
    flex: 1,
    padding: 20,
  },
  searchView: {
    width: "88%",
    justifyContent: "space-between",
    alignItems: "center",
    flexDirection: "row",
    height: 50,
    marginTop: 10,
  },
  inputText: {
    justifyContent: "center",
    alignItems: "center",
    color: "#000",
    borderRadius: 50 / 2,
    borderColor: "#000",
    borderWidth: 2,
    width: "80%",
    height: 50,
    paddingLeft: "6%",
    fontSize: 20,
    fontWeight: "500",
    backgroundColor: "white",
  },
  btnSearch: {
    backgroundColor: "white",
    borderRadius: 10,
    marginLeft: 10,
    justifyContent: "center",
    alignItems: "center",
    height: 30,
    borderWidth: 2,
  },
  searchTxt: {
    fontSize: 20,
    color: "black",
    fontWeight: "bold",
  },
  HeaderTitle: {
    color: "#000",
    fontSize: 30,
    fontWeight: "bold",
    paddingTop: 10,
    textAlign: "center",
  },
  btnAdd: {
    backgroundColor: "#d81b60",
    width: 45,
    height: 45,
    alignItems: "center",
    justifyContent: "center",
    borderRadius: 45 / 2,
  },
  btnView: {
    justifyContent: "center",
    alignItems: "center",
  },
  ItemComponent: {
    width: 320,
    height: 160,
    borderRadius: 10,
    borderWidth: 1,
    borderColor: "#d81b60",
    paddingLeft: 10,
    margin: 10,
    backgroundColor: "#ede7f6",
    flexDirection: "row",
  },
  img: {
    width: 120,
    height: 120,
    borderRadius: 20,
    alignSelf: "center",
  },
  itemDetail: {
    marginLeft: 24,
    marginBottom: 28,
    justifyContent: "center",
  },
  name: {
    color: "#d81b60",
    fontSize: 22,
    marginTop: 8,
    marginLeft: -4,
  },
  price: {
    color: "#d81b60",
    fontSize: 20,
  },
  quantity: {
    color: "#d81b60",
    fontSize: 20,
  },
  btn: {
    flexDirection: "row",
    justifyContent: "center",
    alignItems: "center",
  },
  btnTxt: {
    fontSize: 20,
  },
  footer: {
    borderWidth: 1,
    borderRadius: 20,
    backgroundColor: "#98ee99",
    marginTop: 10,
    justifyContent: "space-around",
    width: 156,
  },
});
